
import pandas as pd
from pandas import Series
from pandas.tseries.offsets import BDay
import tushare as ts


def count_stocks(labels, stocks):
    ndicts = {}
    exists = []
    reserved = []
    for label, stock in zip(labels, stocks):
        for k, v in stock.items():
            if k:
                ndicts[k] = v

    scount = Series(list(ndicts.keys())).value_counts()
    for index in scount[:20].index:
        print(index, ndicts[index])
    # print(scount[:20])
    res = scount[:20].index
    endtime = pd.datetime.today()
    starttime = endtime - BDay(7)
    starttime = starttime.strftime('%Y-%m-%d')
    endtime = endtime.strftime('%Y-%m-%d')

    for i in res:
        hist = ts.get_hist_data(code=i, start=starttime, end=endtime)
        # print(hist)
        # print(i)
        apped = True
        if hist is not None:
            l = len(hist)
            if hist['close'].mean() < 21 and l > 5:
                for j in range(1, 4):
                    test = hist['close'][j] < hist['close'][j - 1] or abs(hist['close'][j] - hist['close'][j - 1]) < 1 
                    if not test:
                        apped = False
                        break
                if apped:
                    reserved.append(i[-6:])

    # print(reserved)
    return reserved


